/* AGENT_SHEET */
/*
 * YouTube - dark gray redesign
 *
 * Author      : Valacar
 * Updated     : December 25th, 2007
 * Website     : http://www.valacar.com/userstyles/ - altered by Totz/
 * Description : Modifies the colors, logos, and a few other images on YouTube (http://youtube.com/)
 * Usage       : Use with Stylish Firefox extension (http://userstyles.org/) or copy to your Firefox userContent.css file
 */

@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("youtube.com") {

body {
	background: #101010 !important;
	color: #ddd !important;
}

a:link, a:visited, a:active { color: #fff !important; }
:focus { outline: none !important; }
.eLink { border-bottom: 1px solid #666 !important; }

/* Text colors */
span, div, p, li, td, label { color: #ddd !important; }
input *, textarea * { color: -moz-fieldtext !important; }


/* Text headers */
h1, h2, h3, h4, h5, h6, .hpBlockHeadingGray, .name, .title, #vidTitle, .wsHeading, .header, #catIndexGridHeading, #footer .links th {
	color: #FF6600 !important;
}

/* Highlight Blocks */
#footContent, #footer, #channelVidsDiv, [style*="background-color: rgb(238, 238, 238)"], [style*="background-color: white"], #catIndexFeaturedWrapper, .memberContainer, .highlightBoxes, .highlightBoxesOpacity[class], .highlightBox, .attentionBox, #actionsAndStatsDiv, #statsBox, .settingDiv, #vResponseParent, #vrParentDiv, #localePickerBox, .notopbox, #relatedVidsBody, .changeSearchTypeLinks, .lowlightBox, .vNowPlaying, #guidelines, .highlightBoxBrowse, fieldset, .commentsTooltip, .cat-spotlight-box, #actionsAreaDiv .moreAction, #sendMessage td, #addToFavesResult, #copyrightText, #videoOwnerDiv, #loginForm, #signupForm, #accountQuickLinksMore div, .spotlightItem, #search-settings-form, #addToPlaylistResult, #addToFavesResult, #addToBlogResult, [id^="reportConcernResult"], table[bgcolor="#bbccee"], #notopbox {
	background: #282828 !important;
	border-color: #FF6600 !important;
}

/* Various background color fixes */
[bgcolor="#ffffff"], [bgcolor="#ffffbb"], [style*="background-color: rgb(255, 255, 255)"], #exContentWrapper, #exRelatedDiv, #exUserContentDiv, #exPlaylistDiv, #hpEmbedUnderBlock, .basicBoxes, .basicBoxesOpacity[class], .pagingDiv, #hpContentBlock, .vListBox, .previewBox, .vGridBox, .dBG, .rBG, #vlogBox div, .empty_player_list, .form_fieldsets, .form_fieldset, #ticker, .user-thumb-large, .footerBox, #pageContainer, #manageContent[style*="background"] {
	background: #000 !important;
}
[bgcolor="#eeeeee"], .eeeBG, #groupTopicTopEntry, .field_inputs {
	background-color: #282828 !important;
}
.errorBox { background-color: #600 !important; color: #ffc !important; }


/* Various border color fixes */
hr, .hr, .contentBox, .commentPagination, .wsBody, #catIndexFeaturedVideo, #videoDetailsDiv, #videoStatsDiv, #embedDiv, #footTopDiv, #groupCommonHeader, .basicBoxes, .statsDiv, .vEntry, #sectionHeader, .bulletinTable td, .channelIcon, .channelIconWrapper, #catIndexGridHeading, .commentsTableFull td, .vListBox, .relatedDivider, #channelVidsBody, .myvSpacer, #viewPublicChannel, .vDetailEntry, .vGridBox, #preFooter, #searchSortContainer, .commHeading, .watchSectionBody, .searchFooterBox div, #customizeEmbedDiv, #recentRatingsDiv, .footColumnLeft, .footColumnMid, .brandedInfoBox, .settingHead, .field_inputs, .bottomBorderDotted, #embedDiv, #urlDiv, .vloggingBoxesContainer, #footer .links, #footer, #header-wrapper, #subsubNav, .relVidsCellBorder, .vlentry, .vlfacets, [style*="border-left: 1px solid rgb(204, 204, 204)"], #search-options-container, .footerBox, .pagerNotCurrent  {
	border-color: #FF6600 !important;
}

/* thumbnail borders */
[class$="WrapperInner"], .videobarthumbnail_white, .videobarthumbnail_gray { border-color: transparent !important; }
[class$="WrapperOuter"], [class^="vimg"] { border-color: transparent !important; }
.video-thumb-medium, .video-thumb-small, .user-thumb-large { border: none !important; }

/* Ads */
iframe, #bottomAdDiv, #leaderboardAd, .spOffersDiv, #sideContent, img[src^="/img/ad_"], a[href*="doubleclick.net"], #sideAd, img[src^="/img/pic_verizonwireless"], img[src*="pic_verizon_yellow_146x22.gif"], #FLASH_AD, #channelBrandCap, #ad300x250, #channelBrandDiv, [id^="myAd_"], object[width="160"][height="600"]
{
	display: none !important;
}

/* remove "Videos being watched right now" */
#hpMainContent #active_sharing_div
{
	display: none !important;
}


/* Purple and Yellow blocks
--------------------------*/
.hpPurpleBlock, .hpYellowBlock {
	background: #FF6600 !important;
	padding: 8px 10px !important;
	border: 1px solid #FF9900 !important;
}

.hpPurpleBlockBot, .hpYellowBlockBot { display: none !important; }


/* Channels masthead
---------------------*/
.channelMastheadTable, #mastheadTable {
	background: #333 !important;
	padding-bottom: 10px !important;
	-moz-border-radius-bottomleft: 9px !important;
	-moz-border-radius-bottomright: 9px !important;
}

img[src="/img/masthead_round.gif"], #smallMastheadBottom { display: none !important; }


/* Header and Comment Bars
---------------------------*/
.headerBox, .headerBoxOpacity {
	background-color: #333 !important;
	border-color: #FF6600 !important;
}

.commentHead, #vResponseHeading, .commentHeadHidden { background: #333 !important; }
.commentHead { border-top: 1px solid #555 !important; }
.commentEntry { margin-bottom: .3em !important; }
.commentAuthHead { background: #555 !important; }
.opacity80 { opacity: 0.7 !important; }
.commentSpam { background: #222 !important; }

.headerRCBox * { background: #333 !important; border-color: #FF6600 !important; }


/* Featured Video tabs
-----------------------*/
.hilite {
	background-color: #000 !important;
	border-color: #FF6600 !important;
}

#hpFeaturedAndSmallTabs {
	background-color: #333 !important;
}

#hpFeaturedHeading  { border-color: #666 !important; }


/* Subscription box
-------------------*/
img[src*="pic_subsbox_"] { display: none !important; }
#hpSubsBoxTop, #hpSubsBox { background: #000 !important; border: none !important; }
#vbror, #vbrol { opacity: 0.3 !important; }
#hpSubsBox table td { background: #FF9900 !important; }


/* Pager
--------*/
.pagerNotCurrent { background: transparent !important; color: #ccc !important; }
.pagerCurrent { background: #666 !important; color: #fff !important; border: 1px solid #FF9900 !important; }

/* Main tabs
-------------*/
#masthead .nav-item .content { color: #999 !important; }
#masthead .nav-item.selected .content { color: #fff !important; }


/* My Account */
#manageNav .selected, #manageContent [bgcolor="#cccccc"], #manageContent .controls, #manageContent #compose {
	background: #333 !important;
}

#manageContent tr[bgcolor="#cccccc"] td { background-color: #333 !important; }

#manageContent [bgcolor="#f7f7f7"] {
	background: transparent !important;
}

#manageContent, #manageContent [style*="border"] {
	border-color: #333 !important;
}



/* Small tabs (Featured / Most Viewed / Most Discussed / Top Favorites)
-----------------------------------------------------------------------*/

#hpFeaturedAndSmallTabs, #hpFeaturedHeading {
	border-bottom: 1px solid #484848 !important;
}

#hpSmallTabsContainer .hilite {
	border: 1px solid #FF9900 !important;
	border-bottom: none !important;
	margin-top: -3px !important;
}

/* History tabs (yuck!)
-----------------------*/

#tabset { background-image: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAAjCAIAAADaE/fjAAAABGdBTUEAAK/INwWK6QAAABl0RVh0U29mdHdhcmUAQWRvYmUgSW1hZ2VSZWFkeXHJZTwAAAAfSURBVHjaYrKxsWFiYGDAwP///8dK45PDp4YIDBBgALN2G+DpvkDNAAAAAElFTkSuQmCC) !important; }
x#tabset #vh { background-image: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAAjCAIAAADaE/fjAAAABGdBTUEAAK/INwWK6QAAABl0RVh0U29mdHdhcmUAQWRvYmUgSW1hZ2VSZWFkeXHJZTwAAAAsSURBVHjaYlJRUWFiYGAgCjMyMjIxMzMzwQCIDRKDYZgaZDayGC5xKBsgwABfeAD7fiqkYQAAAABJRU5ErkJggg==) !important; }
#tabset .tab, .fauxBtn { background-image: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAAjCAIAAADaE/fjAAAABGdBTUEAAK/INwWK6QAAABl0RVh0U29mdHdhcmUAQWRvYmUgSW1hZ2VSZWFkeXHJZTwAAAAjSURBVHjaYraxsWFiYGDAwP///4fT6BibOLIYNvOIwAABBgB2eCTYI8eCYAAAAABJRU5ErkJggg==) !important; }

#tabset, #tabset .tab, .fauxBtn, .fauxBtn a { border-color: #555 !important; }
#tabset #vh, #tabset #as, #tabset #ql { border-bottom-color: #303030 !important; border-right-color: #555 !important; }
.tabpad a { color: #aaa !important; }


/* Menus
-------- */

.browseDropDownMenu, .browseDropDownMenu div a , .dropdown, .dropdown div a, .dropdown div {
	background-color: #333 !important;
	border-color: #444 !important;
	color: #aaa !important;
}
.browseDropDownMenu div a:hover, .dropdown div a:hover {
	background-color: #666 !important;
	color: #fff !important;
}

#videoListsBtn, #videoTimeBtn, .subNav-arrowbox {
	border-color: #4f4f4f !important;
}



/* Tweaks
----------------- */

/* expand thumbnail listings on videos page */
#mainContentWithNav {
	width: 705px !important;
}

/* horizontal menu at top right of page is an iframe sometimes */
iframe[src="/user_info"] {
	display: inline !important;
}

/* removed rounded corners on fieldsets */
.fieldsetTop, .fieldsetBottom {
	visibility: hidden !important;
}

/* QuickList current selection */
.playlistRowPlaying {
	background-color: #383838 !important;
	border-color: #555 !important;
}

/* "no video" icon */
img[src="/img/no_videos_140.jpg"] {
	opacity: 0.25 !important;
}

/* upload button text */
.uploadtext { color: #000 !important; }

/* highlight left menu selected item */
.category-selected { background: #444 !important; }


/* Image Replacements
----------------------*/

#masthead .logo img,
#logoHome,
#iconMail,
#iconMail.noMail,
.activeSharingGreen,
.activeSharingRed,
.globalFlag,
#mastheadUploadBtn,
.icn_star_full_11x11gif, img.rating[src="/img/icn_star_full_11x11.gif"],
.icn_star_half_11x11gif, img.rating[src="/img/icn_star_half_11x11.gif"],
.icn_star_empty_11x11gif, img.rating[src="/img/icn_star_empty_11x11.gif"],
.icn_star_grey_full_11x11gif,
.icn_star_grey_half_11x11gif,
.icn_star_grey_empty_11x11gif,
.icn_star_full_19x20gif,
.icn_star_half_19x20gif,
.icn_star_empty_19x20gif,
.icn_star_full_19x20png,
.icn_star_half_19x20png,
.icn_star_empty_19x20png,
#debates_footer_img,
.LeftSingleArrow,
.LeftSingleArrow:hover,
.RightSingleArrow,
.RightSingleArrow:hover,
.commentDown,
.commentDownHover,
.commentDownHover:hover,
.commentDownOn,
.commentUp,
.commentUpHover,
.commentUpHover:hover,
.commentUpOn,
.spotlightDotOff,
.spotlightDotOn,
#masthead .nav-item.selected .leftcap,
#masthead .nav-item.selected .rightcap,
#masthead .nav-item .leftcap,
#masthead .nav-item .rightcap,
#masthead .nav-item,
#masthead .nav-item.selected,
#masthead .search-bar,
#masthead .bar .rightcap,
#masthead .bar .leftcap,
#relatedList,
#relatedNotList,
#relatedGrid,
#relatedNotGrid,
.arrowDown,
.arrowRight,
.expand-container .expand-header .arrow,
#i1,
#a1_i1:hover #i1, #i1:hover,
#i2,
#a2_i2:hover #i2, #i2:hover,
#i3,
#a3_i3:hover #i3, #i3:hover,
#i4,
#a4_i4:hover #i4, #i4:hover,
img[src="/img/icn_help_grey_16x16.gif"],
#ticker img[alt="footer-promo"]
{
	/* master image containing many smaller images */
	background-image: url(data:image/png;base64,) !important;
background-color: transparent !important;
}


#masthead .logo img {
width: 122px !important;
height: 46px !important;
margin: 0 !important;
}

img.rating[src="/img/icn_star_full_11x11.gif"],
img.rating[src="/img/icn_star_half_11x11.gif"],
img.rating[src="/img/icn_star_empty_11x11.gif"]
{
	width: 0 !important;
	height: 11px !important;
	padding-left: 11px !important;
	background-position: -439px 0 !important;
}

img.rating[src="/img/icn_star_half_11x11.gif"]
{
	background-position: -450px 0 !important;
}

img.rating[src="/img/icn_star_empty_11x11.gif"]
{
	background-position: -461px 0 !important;
}

/* Red "selected" dot */
img[src="/img/pic_selected_dot_9x9.gif"] {
	width: 0 !important;
	height: 9px !important;
	padding-left: 9px !important;
	background: url("data:image/png;base64,") top left no-repeat !important;
}

/* Help "?" icon */
img[src="/img/icn_help_grey_16x16.gif"] {
	width: 0 !important;
	height: 16px !important;
	padding-left: 16px !important;
	background-position: -265px -36px !important;
}

/* "no text" logo */
img[src*="c_logo_no_text.gif"], #smallMastheadLogo {
	width: 0 !important;
	height: 37px !important;
	padding-left: 104px !important;
	background: url("data:image/gif;base64,") top left no-repeat !important;
}

/* drop down menu */
.subNav-arrow, #videoListsBtn:hover .subNav-arrowbox, #videoTimeBtn:hover .subNav-arrowbox, #videoListsBtn .subNav-arrowbox:hover, #videoTimeBtn .subNav-arrowbox:hover, #videoListsBtn, #videoTimeBtn, .dropdown-link img {
	background-image: url(data:image/png;base64,) !important;
}

.dropdown-link img {
	background-position: 0 -40px !important;
	width: 12px !important;
}


}
